import logo from "./img/logo.svg";

const App = () => {
  return (
  <>
    <nav className="relative container  mx-auto p-6">
      <div className="flex items-center justify-between py-4 border-b-2 border-gray-700 text-gray-300 font-semibold text-sm">
        <img className="h-8" src={logo} alt="Workflow" />
      </div>
      <div className="hidden md:flex space-x-6">
        <span className="text-gray-300 hover:text-gray-500" href="#">Price</span>
        <span className="text-gray-300 hover:text-gray-500" href="#">Product</span>
        <span className="text-gray-300 hover:text-gray-500" href="#">About Us</span>
        <span className="text-gray-300 hover:text-gray-500" href="#">Contact</span>
      </div>
        {/* <button  className='flex items-center justify-center bg-gray-800 text-white rounded-full px-4 py-2 focus:outline-none focus:shadow-outline'>
          some
        </button> */}

    </nav>
  </>
  );
}
export default App
